import { useInput } from "./logic";
function App() {
  const [username, usernameInput] = useInput({ placeholder: 'jdoe123' });
  const [password, passwordInput] = useInput({ placeholder: 'Password' });

  return (
    <>
      {usernameInput}
      <p>{username}</p>
      {passwordInput}
      <p>{password}</p>
    </>
  );
}
export default App;
